import React, { Component } from 'react';

export default class CreateContact extends Component {
    constructor(props) {
        super(props)

        this.state = {
            Nome: '',
            Telefone: '',
            Link: '',
            LinkAlt: ''
        }
        this.changeFirstNomeHandler = this.changeFirstNomeHandler.bind(this);
        this.changeTelefoneHandler = this.changeTelefoneHandler.bind(this);
        this.changeLinkHandler = this.changeLinkHandler.bind(this);
        this.changeLinkAltHandler = this.changeLinkAltHandler.bind(this);
        this.saveContact = this.saveContact.bind(this);
    }





    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="card col-md-6 offset-md-3 offset-md-3">
                        <div className='card-body'>
                            <div className='form-group'>
                                <text className='text'>Nome</text>
                                <input type="text" className="form-control" placeholder="Jose" />
                            </div>
                            <div className='form-group'>
                                <text className='text'>Telefone</text>
                                <input type="text" className="form-control" placeholder="(00)99999-9999" />
                            </div>
                            <div className='form-group'>
                                <text className='text'>Link image</text>
                                <input type="text" className="form-control" placeholder="http://example.com/imagem.png" />
                            </div>
                            <div className='form-group'>
                                <text className='text'>Link imagem celular</text>
                                <input type="text" className="form-control" placeholder="http://example.com/imagem.png" />
                            </div>
                        </div>
                    </div>
                </div>
            </div>

        )
    }

}
